void usage() {
    printf("Usage: ./bgmi ip port [time] threads\n");
    exit(1);
}

// Function to specify the expiration date easily
void set_expiration_date(int *year, int *month, int *day) {
    *year = 2024;  // Change this to your desired year
    *month = 9;   // Change this to your desired month (1-12)
    *day = 27;     // Change this to your desired day (1-31)
}

bool is_expired() {
    int year, month, day;
    set_expiration_date(&year, &month, &day);

    struct tm exp_date = {0};
    exp_date.tm_year = year - 1900;  // Year since 1900
    exp_date.tm_mon = month - 1;     // Month is 0-11
    exp_date.tm_mday = day;

    time_t exp_time = mktime(&exp_date);
    time_t current_time = time(NULL);

    return difftime(current_time, exp_time) > 0;
}

